import React from 'react';
import './App.css';
import Nav from './Nav';
import Home from './Home';
import Page_Principale from './Components/Page_Principale';
import Page_Admin from './Components/Page_Admin';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom'
function App(){
    return(
        <div className="App">
            <Router>
                <Nav></Nav>
                <Route path="/Home" exact component="Home"></Route>
                <Route path="./Components/Page_Principale" exact component="Page_Principale"></Route>
                <Route path="./Components/Page_Admin" exact component="Page_Admin"></Route>





            </Router>
        </div>
    );
}

export default App
